import React, { Component } from 'react';
import {
    Button,
    Icon,
    Rating,
    Header,
    Input,
    Grid,
    Segment,
    Form,
    Message,
    Menu,
    Modal,
    Dropdown,
    Label,
    Container
} from 'semantic-ui-react';

export default class SignIn extends Component {
render() {
    return (
            <Button as='div' labelPosition='right'>
                <Button icon>
                    <Icon name='heart' />
                    Like
                </Button>
                <Label as='a' basic pointing='left'>
                    2,048
                </Label>
            </Button>

    )
    }
}
